CREATE TABLE IF NOT EXISTS `bus_trips` (
    `start_city` VARCHAR(9) CHARACTER SET utf8,
    `start_lat` NUMERIC(6, 4),
    `start_lng` NUMERIC(6, 4),
    `end_city` VARCHAR(9) CHARACTER SET utf8,
    `end_lat` NUMERIC(6, 4),
    `end_lng` NUMERIC(6, 4),
    `trip_start_time` DATETIME,
    `trip_end_time` DATETIME,
    `trip_duration_minutes` INT,
    `traffic_wait_minutes` INT,
    `traffic_level` VARCHAR(6) CHARACTER SET utf8,
    `passenger_count` INT,
    `day_of_week` VARCHAR(9) CHARACTER SET utf8
);
